// SeizureApp.tsx
import React from 'react';
import Timer from "./timer";
import './seizure.css'; // You can create this CSS file for styling

const SeizureApp: React.FC = () => {
    return (
        <div className="seizure-app">
            <header>
                <h1>Seizure</h1>
            </header>
            <div className="content-container">
                <div className="left-content">
                    {/* Big Textbox - You can replace this with your actual textbox */}
                    <textarea placeholder="Add your text here..." />
                </div>
                <div className="right-content">
                    {/* Timer Component */}
                    <Timer />
                    {/* Big Call 911 Button */}
                    <button className="call-911-button">Call 911</button>
                </div>
            </div>
        </div>
    );
};

export default SeizureApp;
